import phone from "../img/Phone.png"

export default function TelfContact({className}) {
    return (
        <div className={className}>
            <div> <img src={phone} alt="phone" /> </div>
            <div>
                <a href="tel:+34919490518">+34 919 49 05 18</a>
            </div>
        </div>
    )
}
